import styles from "Page404.module.css";

export default function Page404() {
    var context = new AudioContext();
var playNote = function (frequency, vol, startTime, duration) {
    var osc = context.createOscillator(),
    volume = context.createGain();
    volume.gain.value = vol;
    volume.gain.setValueAtTime(vol, startTime + duration - 0.05);
    volume.gain.linearRampToValueAtTime(0, startTime + duration);
    osc.frequency.value = frequency;
    osc.type = 'sine';
    osc.connect(volume);
    volume.connect(context.destination);
    osc.start(startTime);
};
  return (
    <>
     <body id="not-found" dir="ltr" itemscope="itemscope" itemtype="http://schema.org/WebPage">
	<div class="layout">
		<div class="container">
      <div class="flexmachine">
        <div class="center-box">
          <main class="main" role="main" itemprop="mainContentOfPage" aria-label="Main Content Of Page">
            <article class="hfeed" itemscope="itemscope" itemtype="http://schema.org/CreativeWork">
              <header class="entry-header">
                <h1 class="entry-title" itemprop="headline">404</h1>
              </header>
              <div class="entry-content" itemprop="text">
                <p>Page not found</p>
              </div>
              <footer class="entry-footer">
              </footer>
            </article>
          </main>
        </div>
        <aside class="sidebar box-n-e" role="complementary" itemscope="itemscope" itemtype="http://schema.org/WPSideBar" aria-label="Sidebar">
          <div class="wrap">
            <div class="widget"></div>
          </div>
        </aside>
        <aside class="sidebar box-n-w" role="complementary" itemscope="itemscope" itemtype="http://schema.org/WPSideBar" aria-label="Sidebar">
          <div class="wrap">
            <div class="widget"></div>
          </div>
        </aside>
        <aside class="sidebar box-s-w" role="complementary" itemscope="itemscope" itemtype="http://schema.org/WPSideBar" aria-label="Sidebar">
          <div class="wrap">
            <div class="widget"></div>
          </div>
        </aside>
        <aside class="sidebar box-s-e" role="complementary" itemscope="itemscope" itemtype="http://schema.org/WPSideBar" aria-label="Sidebar">
          <div class="wrap">
            <div class="widget"></div>
          </div>
        </aside>
      </div> 
    </div> 
	</div> 
</body>
    </>
  );
}
